import * as React from 'react';
import Header from 'features/common/components/Header'
import Footer from 'features/common/components/Footer'
import styled from "styled-components";

import 'features/corona/style/ChartLayOutStyle.css'
import { AppBugReports, HeaderChart, MainChart, StackChart } from 'features/corona/index';

const ChartLayOut = (props) => {
  return (
    <div class = "wrapper">
      <div class="Chartcontainer">
      <span className="header"><Header/></span> 

        <span class ="item6"><HeaderChart/></span>
        <span class ="item7"><AppBugReports payload={{'label':'text', 'value': 10}}/></span>
        <span class ="item8"><AppBugReports/></span>
        <span class ="item9"><AppBugReports/></span>
        <span class ="item10"><AppBugReports/></span>
        <span class ="item11"><StackChart/></span>
        <span class ="item12"><MainChart/></span>
        
      <span class="ChartFooter"><Footer/></span>
      </div>
    </div>
  );
}

export default ChartLayOut;
